const t=JSON.parse('{"key":"v-72782d46","path":"/content/%EF%BC%88%E4%BA%94%EF%BC%89%E4%B8%8D%E5%A4%B1.html","title":"七义句：（五）不失","lang":"zh-CN","frontmatter":{"title":"七义句：（五）不失","description":"【《金刚般若论》学习笔记】思维导图：七义句（五）不失。","pdf":"/pdf/（五）不失.pdf","scale":1.2,"associatedInfo":[{"x":514,"y":73,"kind":"批注","text":"依个人理解，此处断句方式应如下：\\n“若于如言辞法中，分别、执有自性，是增益边”\\n"},{"x":1140,"y":119,"kind":"备注","text":"<\\n参见《金刚般若论会释》：\\n以虽不说亦自知故者。谓依真谛。妄计所执。不共之法。佛虽不说。以为真道般若之体。令人修学佛亦自知为无。故无自性。\\n>\\n"},{"x":959,"y":128,"kind":"备注","text":"<\\n参见《金刚般若论会释》：\\n不共者。不与相应义。谓妄所执。佛所说不与相应。相应者相契当故。所说契理故。解不共相应中。初标二。后重解。重解中但解相应。所不相应即是不共。\\n>\\n"}],"head":[["meta",{"property":"og:url","content":"http://www.jgbrl-mindmap.com/content/%EF%BC%88%E4%BA%94%EF%BC%89%E4%B8%8D%E5%A4%B1.html"}],["meta",{"property":"og:site_name","content":"《金刚般若论》学习笔记（思维导图）"}],["meta",{"property":"og:title","content":"七义句：（五）不失"}],["meta",{"property":"og:description","content":"【《金刚般若论》学习笔记】思维导图：七义句（五）不失。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"七义句：（五）不失\\",\\"image\\":[\\"\\"],\\"dateModified\\":null,\\"author\\":[]}"]]},"headers":[],"git":{},"filePathRelative":"content/（五）不失.md"}');export{t as data};
